from typing import List

class Solution:
    def goodSubsetofBinaryMatrix(self, grid: List[List[int]]) -> List[int]:
        m, n = len(grid), len(grid[0])
        best_subset = []

        for mask in range(1, 1 << m):
            subset = [row for row in range(m) if mask & (1 << row)]
            col_sums = [0] * n
            valid = True

            for row in subset:
                for col in range(n):
                    col_sums[col] += grid[row][col]

            for sum in col_sums:
                if sum > len(subset) // 2:
                    valid = False
                    break

            if valid and (not best_subset or len(subset) > len(best_subset)):
                best_subset = subset

        return best_subset
